import ReactDOM from 'react-dom';
import { BrowserRouter } from 'react-router-dom';

import { AuthConextProvider } from './store/auth-context';
import App from './App';
import './index.css';

ReactDOM.render(
  <AuthConextProvider>
    <BrowserRouter>
      <App />
    </BrowserRouter>
  </AuthConextProvider>,
  document.getElementById('root')
);
